// src/components/Dashboard.js
import React, { useState, useEffect } from 'react';
import { toast } from 'react-toastify';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5005/api';

const Dashboard = () => {
  const [clientId, setClientId] = useState(localStorage.getItem('clientId') || '');
  const [authToken, setAuthToken] = useState(localStorage.getItem('authToken') || '');
  const [loading, setLoading] = useState(false);
  const [oxCodes, setOxCodes] = useState([]);
  const [clientInfo, setClientInfo] = useState(null);

  useEffect(() => {
    fetchOxCodes();
  }, []);

  const fetchOxCodes = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${API_URL}/ox-codes`, { withCredentials: true });

      if (response.data && Array.isArray(response.data)) {
        setOxCodes(response.data);
      }
    } catch (error) {
      console.error('Error fetching OX codes:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="row">
      <div className="col-md-12">
        <div className="card">
          <div className="card-header bg-success text-white">
            <h4>Authentication Successful</h4>
          </div>
          <div className="card-body">
            <div className="alert alert-success">
              <h5>Welcome, Client ID: {clientId}</h5>
              {authToken && (
                <div className="mt-3">
                  <p className="mb-1">Your OX Code:</p>
                  <div className="p-3 bg-light rounded border">
                    <code>{authToken}</code>
                  </div>
                  <p className="mt-2 text-muted">
                    This OX code has been securely stored in our database and can be used for API access.
                  </p>
                </div>
              )}
            </div>

            <div className="row mt-4">
              <div className="col-md-12">
                <h5>Authentication History</h5>
                {loading ? (
                  <div className="text-center my-4">
                    <div className="spinner-border text-primary" role="status">
                      <span className="visually-hidden">Loading...</span>
                    </div>
                  </div>
                ) : (
                  <div className="table-responsive">
                    <table className="table table-striped table-hover">
                      <thead>
                        <tr>
                          <th>Date & Time</th>
                          <th>OX Code</th>
                        </tr>
                      </thead>
                      <tbody>
                        {oxCodes.filter(code => code.client_id === clientId).map((code, index) => (
                          <tr key={code.id || index}>
                            <td>{code.timestamp}</td>
                            <td>
                              <code>{code.ox_code}</code>
                            </td>
                          </tr>
                        ))}
                        {oxCodes.filter(code => code.client_id === clientId).length === 0 && (
                          <tr>
                            <td colSpan="2" className="text-center">No authentication history found</td>
                          </tr>
                        )}
                      </tbody>
                    </table>
                  </div>
                )}
              </div>
            </div>

            <div className="alert alert-info mt-4">
              <h5>Next Steps</h5>
              <p>
                You are now authenticated with the Motilal Oswal Financial Services API.
                You can use your OX code to access the API services.
              </p>
              <p className="mb-0">
                For any issues or support, please contact your account manager.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
